Judgment Day #5
Publisher:  Lightning Comics
Publication Date:  January 1994

Writer:  Joseph A. Zyskowski
Penciler:  Eric Pence and Terral Lawrence
Inker:  Patricia Laskowski, David Mowry, Frank Parr, and Mark Lasota
Colorist:  Brian Rohrbeck, Mike Champion, and Greg Weed
Letterer:  James M. Anderson and David Marquis
Cover:  Eric Pence and Patricia Laskowski

Believing the current Safeguard to be dead, a new Safeguard robot is activated. Salubrio convinces a captive Rift to get them all out of Hell, then she kills him.

